Discovering: Dire Straits
Music journalists Camilla Pia, John Aizlewood, Will Hodgkinson, Michael Bonner and Hamish MacBain examine the history of the rock band and reflect on their success, Dire Straits. Led by Mark Knopfler, the band recorded six studio albums, including the bestselling Brothers in Arms.
Dire Straits were a British rock band who emerged during the post-punk era of the late 1970s, active between 1977 and 1995. Comprising Mark Knopfler (lead vocals and lead guitar), his younger brother David Knopfler (rhythm guitar and backing vocals), John Illsley (bass guitar and backing vocals), and Pick Withers (drums and percussion),

